import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";

const RolezandoList = () => {
  const [list, setList] = useState([]);
  const [hasError, setHasError] = useState(false);

  useEffect(() => {
    const data = fetch(
      "https://opensheet.elk.sh/1o5t26He2DzTweYeleXOGiDjlU4Jkx896f95VUHVgS8U/Test+Sheet"
    )
      .then((res) => res.json())
      .then((data) => {
        data.forEach((row) => {
          // Do something with each row here.
        });
      });

    data.then((result) => console.log(result));
  }, []);

  return (
    <>
      {list.map((item) => (
        <RoleItem data={item} />
      ))}
    </>
  );
};

export default RolezandoList;
